    false,nt"url": null,nt"notes": "Soils: 1:24000 SSURGO Map. Polygon boundaries
    of Soils in Volusia County, downloaded from SJRWMD and created by NRCS and SJRWMD.
    This data set is a digital version of the county soil survey and is generally the
    most detailed level of soil geographic data developed by the SJRWMD and National
    Resources Conservation Service (NRCS). The SJRWMD contracted with private vendors
    to develop most of the counties' data, by compiling information onto a planimetric
    correct base and digitizing. SSURGO depicts information about the kinds and distribution
    of soils on the landscape. The soil map and data used in the SSURGO product were
    prepared by soil scientists. This data set is not designed for use as a primary
    regulatory tool in permitting or citing decisions, but may be used as a reference
    source.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
